namespace Cubiche\Domain\Locale\Tests\Units;

use Cubiche\Domain\Locale\CountryCode;

/**
 * CountryCodeTests class.
 *
 * Generated by TestGenerator on 2018-01-15 at 13:40:07.
 */
class CountryCodeTests extends TestCase
{
    /**
     * Test fromNative method.
     */
    public function testFromNative()
    {
        $this
            ->given($countryCode = CountryCode::fromNative('as'))
            ->then()
                ->boolean($countryCode->equals(CountryCode::AS()))
                    ->isTrue()
                ->and()
                ->when($countryCode = CountryCode::fromNative('DO'))
                ->then()
                    ->boolean($countryCode->equals(CountryCode::DO()))
                        ->isTrue()
        ;
    }
}
